      <TextField id="outlined-basic" label="Term" variant="outlined" />
      <TextField id="outlined-basic" label="Properties" variant="outlined" />
      <TextField id="outlined-basic" label="Additional Securities" variant="outlined" />
      <TextField id="outlined-basic" label="is Coborrowed" variant="outlined" />
      <Button variant="contained">Submit</Button>;
      </form>

          </Box>
      </Container>
    </React.Fragment>
    <div className="App">








    </div>
    </>
  );
}

export default App;
